import React from "react";
import Container from "react-bootstrap/Container";

function Home() {
    return(
        <Container>
            <img src="https://images.unsplash.com/photo-1578926078640-668b1fb75403?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=2438&q=80"/>
        </Container>
    )
}

export default Home;
